import Typed from 'react-typed';


export default function ErrorPage(props) {
  return (
    <div className="container text-center">
<h1 className="mt-5 mb-3">

Something's not right...
</h1>
<br/>
<h4 className="mb-3">
<Typed
                    strings={["Please check your internet connection and try again"]}
                    typeSpeed={30}
                    startDelay= {1000}
                    cursorChar={''}
                />
</h4>
<br/>




<style jsx>
{`
.bottom{
    position: absolute;
    bottom: 0;
    width: 67vw
}
.blue{
    color:  #17a2b8
}

.icon{

    font-size: 50px !important;
    

}
`}
</style>
</div>

  );
}
